(()=>{document.addEventListener("DOMContentLoaded",function(){let o=document.getElementById("locationsStream"),n=document.getElementById("locationsWarning");o.addEventListener("input",e=>{if(e.data==null){n.innerHTML="";return}n.innerHTML="Few tweets are geo-tagged; this dramatically reduces the number of tweets streamed."}),deleteStream=(e,t)=>{let s=[{stream:e,action:t}];socket.send(JSON.stringify(s))},window.socket.onopen=()=>{console.log("Socket opened"),socket.send("Client Connected")},window.socket.onclose=()=>{console.log("Websocket closed")},window.socket.onerror=e=>{console.log(e)},window.socket.onmessage=e=>{let t=JSON.parse(e.data);console.log(t)}});})();
